  \"2015-08-21T22:31:24.891821\",\n\t\"name\": \"community-nursing-home-cnh\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Community Nursing Home (CNH) database
  contains a list of all Community Nursing Home facilities under local contract to
  Veterans Health Administration (VHA). CNH facilities are not managed by VA. Instead,
  CNH facilities are private or public facilities licensed by the state where they
  provide the patient services. Each day all Veterans Affairs Medical Center (VAMC)
  that have a contract with a CNH enter information about the CNH into the Fee Basis
  module of Veterans Health Information Systems and Technology Architecture. This
  information is sent via MailMan to the VA Austin Information Technology Center where
  it is collected in a queue. A quarterly batch process is run on the queue. VAMCs
  that have sent invalid data or VAMCs that have contracts and did not send data are
  notified. Valid data is processed and used to update the database. Quarterly reports
  are sent to the CNHs, VAMCs, Veterans Integrated Service Networks (VISNs), Geriatrics
  & Extended Care Strategic Health Care Group, and VA Central Office (VACO).\",\n\t\"license_title\":
